import React from 'react';
import "./styles.scss";

export class DateInput extends React.Component {
    constructor() {
        super();
    }
    render = () => {

        return (
            <form className="dateInput">
                <input type="date" className="startDate" />
                <input type="date" className="endDate" />
            </form>
        );
    }
}
